import React, { useEffect, useRef } from "react";

const MyCardsPage = ({ businessData }) => {
  const mapRef = useRef();

  useEffect(() => {
    const googleMapScript = document.createElement("script");
    googleMapScript.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_GOOGLE_MAPS_API_KEY&libraries=places`;
    googleMapScript.async = true;
    window.document.body.appendChild(googleMapScript);

    googleMapScript.addEventListener("load", () => {
      const map = new window.google.maps.Map(mapRef.current, {
        center: { lat: businessData.latitude, lng: businessData.longitude },
        zoom: 14,
      });

      const marker = new window.google.maps.Marker({
        position: { lat: businessData.latitude, lng: businessData.longitude },
        map,
        title: businessData.name,
      });
    });
  }, [businessData]);

  return (
    <div>
      <h1>{businessData.name}</h1>
      <p>{businessData.description}</p>
      <div ref={mapRef} style={{ width: "100%", height: "400px" }}></div>
    </div>
  );
};

export default MyCardsPage;
